    return(
        <>
        <div className="wrapper">
            <div className="container">
                <h1 className="heading">To Do List</h1>
                <Input style = {{color: 'white'}} className = "title-input" placeholder = "Title"/>
                <Input type = "textarea" style = {{color: 'white'}} className = "note-input" placeholder = "Note"/>
                <Button className = "btn" style = {{backgroundColor: '#80808023'}} color="primary"><AddIcon/></Button>
                <ul className = "list">
                    <li> jihih<IconButton className = "delete-btn" color="primary"><DeleteIcon/></IconButton></li>
                    <li>Hello</li>
                    <li>Hello</li>
                    <li>Hello</li>
                    </ul>     
            </div>
        </div>
        </>
    )
}


export default App;
